"original": |2-
     The response scope is dependent on the Request.  If the request was
     in relation to an existing RTSP session, the scope of the overload
     response is to this individual RTSP session.  If the request was non-
     session specific or intended to form an RTSP session, it applies to
     all such requests to this proxy.
"fixed": |-
  The response scope is dependent on the Request.  If the request was in relation to an existing RTSP session, the scope of the overload response is to this individual RTSP session.  If the request was non- session specific or intended to form an RTSP session, it applies to all such requests to this proxy.
"ko": |-
  응답 범위는 요청에 따라 다릅니다. 요청이 기존 RTSP 세션과 관련된 경우 오버로드 응답의 범위는 이 개별 RTSP 세션입니다. 요청이 세션과 관련이 없거나 RTSP 세션을 형성하려는 경우 이 프록시에 대한 모든 요청에 ​​적용됩니다.
